    def encrypt_or_decrypt(self, flag):
        """
        This method have responsibility for encrypting or decrypting the origin text.
        :param flag: should be 'e' which means encrypt or 'd' which means decrypt.
        :return: don't return anything.
        """
        # get key (which is integer)
        key = self.text_key.text().strip()
        if not key:
            winsound.PlaySound('SystemExclamation', winsound.SND_ASYNC)
            QMessageBox.warning(self, u"", u"", QMessageBox.Cancel)
        elif not key.isdigit() or int(key) <= 0:
            winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
            QMessageBox.critical(self, u"", u"", QMessageBox.Cancel)
        else:
            try:
                origin, result, key = self.text_origin.toPlainText(), '', int(key)
                if flag == 'e':
                    for i in origin:
                        result += chr((ord(i) + key) % 0x110000)    # chr() arg is in range(0x110000) (1114112)
                elif flag == 'd':
                    for i in origin:
                        result += chr((ord(i) - key) % 0x110000)
                else:
                    pass
                self.text_result.setText(result)
            except Exception:
                winsound.PlaySound('SystemHand', winsound.SND_ASYNC)
                QMessageBox.critical(self, u"", u"", QMessageBox.Cancel)
                self.text_result.setText(u"")
            else:
                if self.clip.isChecked():
                    clipboard.copy(result)

    def encrypt_func(self):
        """
        Encrypt method. Provide `e` to encrypt_or_decrypt().
        """
        self.encrypt_or_decrypt('e')

    def decrypt_func(self):
        """
        Decrypt method. Provide `d` to encrypt_or_decrypt().
        """
        self.encrypt_or_decrypt('d')
